            production_countries:
              outMovieDetails?.production_countries?.map((country) => country.name) ?? [],
            spoken_languages:
              outMovieDetails?.spoken_languages?.map((language) => language.name) ?? [],
          }) as DetailPoster,
      ),
    );
  }
}

